            widthWindow: null,
            autoPlaySupported: false, // Флаг для проверки автозагрузки
        }
    },

    components: {
        Swiper,
        SwiperSlide,
    },


    methods: {
        async checkAutoPlaySupport() {
        const video = this.$refs.testVideo;
        if (!video) return;

        try {
            await video.play(); // Попытка начать воспроизведение
            video.pause(); // Останавливаем, чтобы не воспроизводилось сразу

            // Включаем прослушивание завершения видео
            return new Promise((resolve) => {
            video.muted = true; // Убедимся, что видео может воспроизводиться без звука
            video.currentTime = 0; // Перематываем в начало
            video.play(); // Запускаем видео

            const handleEnded = () => {
                video.removeEventListener('ended', handleEnded); // Убираем слушатель
                video.pause();
                this.autoPlaySupported = true; // Устанавливаем флаг поддержки
                this.startAnimPlanets(); // Запускаем вашу анимацию
                resolve(true); // Завершаем Promise
            };

            video.addEventListener('ended', handleEnded); // Ждём завершения
            });
        } catch (error) {
            this.autoPlaySupported = false; // Если воспроизведение невозможно
            this.startAnimPlanets(); // Все равно запускаем анимацию
            return false; // Возвращаем false
        }
        },


        // Функция обновления состояния экрана
        updateScreenSize() {
         this.widthWindow = window.innerWidth;
         console.log(this.widthWindow)

        },
        // Обработчик resize с дебаунсом
        debouncedResizeHandler() {
        clearTimeout(this.resizeTimeout); // Сбрасываем предыдущий таймер
        this.resizeTimeout = setTimeout(() => {
            this.updateScreenSize(); // Выполняем обновление через 1 секунду
        }, 1000); // Интервал дебаунса: 1000 мс
        },



        swiperData(data){

            console.log(data)

            this.counterActivSlide = data.activeIndex
            this.counterPrevievSlide = data.previousIndex
            
            console.log('curent',this.counterActivSlide)
            console.log('previev',this.counterPrevievSlide)

            if(this.counterActivSlide == 0 ){
                // this.playForwardPhone(0)
            }

            else if(this.counterActivSlide == 1 ){
                setTimeout(()=>{
                    this.playForwardPhone(1)
                },1500)
            }
            else if(this.counterActivSlide == 2 ){
                setTimeout(()=>{
                    this.playForward(2)
                },300)

                setTimeout(()=>{
                    this.playForwardPhone(2)
                },1500)
                
            }

            else if(this.counterActivSlide == 3 ){
                setTimeout(()=>{
                    this.playForward(3)

                },300)

                setTimeout(()=>{
             
                    this.playForwardPhone(3)
                },3500)
            }

