                    this.playForward(5)
                },300)

                setTimeout(()=>{
                    this.playForwardPhone(5)
                },1500)
            }

            else if(this.counterActivSlide == 6 ){
                setTimeout(()=>{
                    this.playForward(6)
  
                },300)

                setTimeout(()=>{
  
                    this.playForwardPhone(6)
                },2100)
            }
        },
        

        onSlideChange() {
            // Отключаем возможность перелистывания сразу после смены слайда
            this.allowSlide = false;

            // Включаем возможность перелистывания через 3 секунды
            clearTimeout(this.timer);
            this.timer = setTimeout(() => {
                this.allowSlide = true;
            }, 3000); // 3 секунды
        },



        startAnimPlanets(){
            setTimeout(()=>{
                this.counterActivSlide = 0
            },300)
        },

         playForward(curentVideo) {
            console.log(curentVideo)
            let video = this.$refs[`video${curentVideo}`];
            console.log(video)
            // video.playbackRate = 1; // Обычное воспроизведение
            video.load();
            video.currentTime = 0;
             video.play();
        },

         playForwardPhone(curentVideo) {
            console.log(curentVideo)
            let video = this.$refs[`videoPhone${curentVideo}`];
            console.log(video)
            // video.playbackRate = 1; // Обычное воспроизведение
            video.load();
            video.currentTime = 0;
             video.play();
        },
    },

    setup() {
        let swiperData = ''
