            setTimeout(()=>{
                currentIndex = swiper.activeIndex
            },3000)
        };

        const onWheel = (event) => {
            console.log('onWheel',event.deltaY);

            if(+currentIndex == 6 && event.deltaY > 0){
                swiperData.disable();
                pointEventNoneStatus.value = true
                statusSwiper = false
            }
            else{
                
            }
        };


