                    if(touchData.value.startY > touchData.value.endY){
                   
                        swiperData.disable();

                        if(window.innerWidth < 750){
                            swiperDataMob.disable();
                        }
                        
                        pointEventNoneStatus.value = true
                        statusSwiper = false
                    }
                    

                }
                else{
                    swiperData.enable();

                    if(window.innerWidth < 750){
                            swiperDataMob.enable();
                        }

                    statusSwiper = true
                    pointEventNoneStatus.value = false
                }
            }
            
        };


        const touchMoveEvent = (event) => {
            // console.log('touchMoveEvent',event);
        };

        const touchMoveOpposite = (event) => {
            console.log('touchMoveOpposite',event);
        };


        const handleScroll = (event) => {
        console.log(window.scrollY);
        const currentScrollTop = window.scrollY;

        if (currentScrollTop > lastScrollTop) {
            console.log('Прокрутка вниз');
        } 
        else if (currentScrollTop < lastScrollTop) {
            console.log('Прокрутка вверх');

            if(currentScrollTop <= 0){
              
                if(statusSwiper == false){
             
                    swiperData.slideTo(6)
               
                    swiperData.enable()

                    
                    if(window.innerWidth < 750){
                        swiperDataMob.enable()
                        }
                  
                  
                    statusSwiper = true

                    pointEventNoneStatus.value = false
                }
            }
            else{
                if(currentIndex != 6){
                    swiperData.slideTo(6)
                }
                    swiperData.disable()
                    if(window.innerWidth < 750){
                            swiperDataMob.disable();
                        }
                    pointEventNoneStatus.value = true
                    statusSwiper = false 
            }
        }
        

        lastScrollTop = currentScrollTop; // Обновляем предыдущее значение 
        };

        const initSwiper = (event) => {
            setTimeout(()=>{
                let currentScrollTop = window.scrollY;
                if(event && event.activeIndex){
                
                    if(+currentScrollTop > 0){
                        // swiperData.slideTo(6)
                        // swiperData.enable()
                        // statusSwiper = true
                    }
                }
                console.log('init',currentScrollTop,event);
            },300)
            
        };


        onMounted(() => {
        window.addEventListener('scroll', handleScroll);
   
        });

        onUnmounted(() => {
        window.removeEventListener('scroll', handleScroll);
        });

      return {
        firstSwiper,
        secondSwiper,
        onSwiper,
        setSecondSwiper,
        handleReachEnd,
        onAttemptBeyondEnd,
        onWheel,
        initSwiper,
        touchEvent,
        touchMoveEvent,
        pointEventNoneStatus,
        touchMoveOpposite,
        touchData,
        handleTouchEnd,
        handleTouchMove,
        handleTouchStart,
   
        modules: [Pagination, Mousewheel, Navigation, Controller],
        modules2: [Pagination, Mousewheel, Navigation, Controller],
      };
    },

